import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import MyName from "./MyName";
import Gender from "./Components/Gender";

ReactDOM.render(
    <React.StrictMode>
        {/*<MyName/>*/}
        <Gender/>
        {/*<App/>*/}
    </React.StrictMode>,
    document.getElementById('root')
);

